public class FeatureGroupFactory(string resourceName = null, Action<Humidifier.SageMaker.FeatureGroup> factoryAction = null) : ResourceFactory<Humidifier.SageMaker.FeatureGroup>(resourceName)
{

    internal List<InnerFeatureGroupFeatureDefinitionFactory> FeatureDefinitionsFactories { get; set; } = [];

    internal InnerFeatureGroupThroughputConfigFactory ThroughputConfigFactory { get; set; }

    internal InnerFeatureGroupOfflineStoreConfigFactory OfflineStoreConfigFactory { get; set; }

    internal InnerFeatureGroupOnlineStoreConfigFactory OnlineStoreConfigFactory { get; set; }

    protected override Humidifier.SageMaker.FeatureGroup Create()
    {
        var featureGroupResult = CreateFeatureGroup();
        factoryAction?.Invoke(featureGroupResult);

        return featureGroupResult;
    }

    private Humidifier.SageMaker.FeatureGroup CreateFeatureGroup()
    {
        var featureGroupResult = new Humidifier.SageMaker.FeatureGroup
        {
            GivenName = InputResourceName,
        };

        return featureGroupResult;
    }
    public override void CreateChildren(Humidifier.SageMaker.FeatureGroup result)
    {
        base.CreateChildren(result);

        result.FeatureDefinitions = FeatureDefinitionsFactories.Any() ? FeatureDefinitionsFactories.Select(x => x.Build()).ToList() : null;
        result.ThroughputConfig ??= ThroughputConfigFactory?.Build();
        result.OfflineStoreConfig ??= OfflineStoreConfigFactory?.Build();
        result.OnlineStoreConfig ??= OnlineStoreConfigFactory?.Build();
    }

} // End Of Class

